INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `desp`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(1, 7, 1, 'ঢাকায় মিনি কক্সবাজার খ্যাত মৈনট ঘাট', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s', '<p>বর্ষাকালে পদ্মায় ভেসে বেড়াচ্ছে সারি সারি তরী, সাথে পদ্মার চোখধাঁধানো \r\nজলরাশি, কূলে রয়েছে সারি সারি বাহারি রঙের ছাতার নিচে হেলানো চেয়ার। এছাড়াও\r\n পদ্মার পাড়ে অপূর্ব সূর্যাস্ত দেখে সত্যিই মুগ্ধ হবেন। বলছি রাজধানী ঢাকার\r\n দোহার উপজেলার পশ্চিমে বয়ে যাওয়া পদ্মা নদীর কোলে অবস্থিত মৈনট ঘাটের কথা।\r\n সপ্তাহের ছয় দিন কর্মব্যস্ততায় কাটিয়ে একদিনের ছুটিতে অনেকেই পাড়ি জমান এই\r\n ঘাটে।</p><p><br></p><p>মৈনট ঘাট অর্থাৎ পদ্মার এ-পাড় দোহার উপজেলা এবং ও-পাড় ফরিদপুরের চরভদ্রাসন।\r\n যদিও একসময় ফরিদপুরে যাতায়াতের জন্য কার্তিকপুর বাজার থেকে ঘাট পর্যন্ত \r\nসরু রাস্তা নির্মাণ করা হয়েছিল, তবে পরবর্তীতে ঘাট থেকে ফেরি চলাচলের \r\nপরিকল্পনা গ্রহণ করলেও তা বাস্তবায়ন না হওয়াতে দীর্ঘদিন রাস্তাটি অকেজো পড়ে\r\n থাকে। বেশ কিছুদিন পর রাস্তাটি পুনরায় সম্প্রসারণ করায় নবাবগঞ্জ, দোহার, \r\nশ্রীনগর ও কেরানীগঞ্জের বাসিন্দারা এটি ব্যবহার করছে।</p><p><img style=\"width: 25%; float: left;\" src=\"data:image/jpeg;base64,\" data-filename=\"KKba0kBkcc7xlmQ9_পদ্মায়-ভেসে-বেড়াচ্ছে-পাল-তোলা-নৌকা-Image-Source-bdnews24.jpg\" class=\"note-float-left\"></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p>মৈনট ঘাটের একপাশ জুড়ে রয়েছে চর বা চড়া, মূলত এই চরের জন্যই ঘাটটি বেশ \r\nখ্যাতি অর্জন করেছে। তাছাড়াও অন্যপাশে রয়েছে কীর্তিনাশা নদী বা পদ্মা নদী। \r\nমৈনট ঘাট ভ্রমণের উপযুক্ত সময় বর্ষাকাল, এবং এর আসল সৌন্দর্য উপভোগের জন্য \r\nআপনাকে এই সময়ই আসতে হবে। তবে গ্রীষ্মকালে ঘাটের একপাশ জুড়ে বাদামের চাষ \r\nকরতে দেখা যায়, এবং শীতকালে নদী শান্ত থাকে, পাশাপাশি বেলাভূমিও বেশ বড় মনে\r\n হয়। তাছাড়াও খুব সকালবেলা ঘাটে আসলে দেখতে পাবেন জেলেদের জালে ধরা পড়া \r\nমাছের রাজা ইলিশসহ বিভিন্ন প্রজাতির মাছ। চাইলে আপনিও কিছু টাকার বিনিময়ে \r\nহতে পারেন পদ্মার তরতাজা মাছগুলোর অংশীদার।</p><p><br></p><h2><strong>যাবেন কীভাবে</strong></h2><p>মৈনট ঘাট যাওয়ার জন্য একাধিক পথ রয়েছে। যেকোনো একটি অবলম্বন করেই যাওয়া যাবে সেখানে।</p>\r\n<p><strong>প্রথমত,</strong> রাজধানী ঢাকার গুলিস্তানের গোলাপ শাহর মাজার \r\nআসতে হবে। সেখান থেকে যমুনা পরিবহনের বাস মৈনট ঘাটের উদ্দেশ্যে ছেড়ে যায়। \r\nজনপ্রতি ভাড়া পড়বে ৯০-১০০ টাকা, সময় লাগবে দেড় থেকে দুই ঘন্টা। আসলে সময় \r\nনির্ভর করে রাস্তার যানজটের উপর। মনে রাখবেন, এই পরিবহনের সর্বশেষ বাসটি \r\nমৈনট ঘাট থেকে ঢাকার উদ্দেশ্যে ছেড়ে আসে সন্ধ্যা ছয়টায়।</p><p><br></p><p><strong>দ্বিতীয়ত,</strong> ঢাকার গুলিস্তানের সেই একই জায়গা অর্থাৎ গোলাপ \r\nশাহর মাজার থেকে এন মল্লিক পরিবহনেও আসা যাবে। তবে এই বাসে চড়ে সরাসরি মৈনট\r\n ঘাট যেতে পারবেন না। এজন্য আপনাকে নবাবগঞ্জের মাঝিরকান্দা নামক স্থানে \r\nনামতে হবে। ভাড়া পড়বে ৭০-৮০ টাকার মতো। মাঝিরকান্দা থেকে ব্যাটারি চালিত \r\nঅটোতে ১৫-২০ টাকার বিনিময়ে নামতে হবে দোহারের বাঁশতলা। তারপর সেখান থেকে \r\nআবার আরেকটি অটোতে ১৫-২০ টাকার বিনিময়ে কার্তিকপুর বাজার নামতে হবে। বাজার \r\nথেকে ১০ টাকার বিনিময়ে অটো কিংবা ২০ টাকার বিনিময়ে রিক্সায় পৌঁছে যাবেন \r\nমৈনট ঘাটে।</p><p><br></p><p><strong>তৃতীয়ত,</strong> &nbsp;ঢাকার গুলিস্তানের ফুলবাড়ীয়া থেকে ৯০-১০০ টাকার \r\nবিনিময়ে নগর পরিবহনেও যেতে পারবেন মৈনট ঘাটে। তবে এই বাসটি অন্য রুট \r\nব্যবহার করে, অর্থাৎ নবাবগঞ্জ হয়ে না এসে, আসে মুন্সিগঞ্জ হয়ে। এজন্য \r\nআপনাকে নামতে হবে কার্তিকপুর বাজারে। তারপর বাজার থেকে অটো কিংবা রিক্সায় \r\nচড়ে যেতে পারবেন মৈনট ঘাট। ভাড়া গুনতে হবে অটোতে ১০ টাকা এবং রিক্সায় ২০ \r\nটাকা।</p><h2></h2><p></p>', '24', 'writer-nobin-1225439497.jpg', 'ঢাকায়-মিনি-কক্সবাজার-খ্যাত-মৈনট-ঘাট-5967523429', '2022-12-07 09:46:55', '2022-12-07 08:45:08');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `desp`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(2, 1, 5, 'কোক আর পেপসির মধ্যে চলা নির্বাক প্রতিদ্বন্দ্বিতা', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s', '<p>গ্রীষ্মের প্রচণ্ড দাবদাহে অতিষ্ঠ, তেষ্টায় বুকের ছাতি ফেটে যাবার উপক্রম। \r\nএমন সময় ঠাণ্ডা কোমল পানীয়ের বোতল মুখে লাগিয়ে ঢুক ঢুক করে গিলে নিলেন \r\nঅনেকটা তরল। নিমিষেই জুড়িয়ে এলো প্রাণ। এরকম দৃশ্য গরমকালে অনেক দেখা যায়। \r\nকাঠফাটা রোদে তৃষ্ণার্ত গলাকে তৃপ্তি দিতে কার্বোনেটেড সফট ড্রিংকস বা কোমল\r\n পানীয়ের জুড়ি মেলা ভার। সফট ড্রিংকসের নাম শুনলেই কোকা-কোলা আর পেপসির \r\nনামটা সবার আগেই মনে চলে আসে। ব্রাজিল-আর্জেন্টিনা, বার্সেলোনা-রিয়াল \r\nমাদ্রিদ, ভারত-পাকিস্তানের মতো কোকা-কোলা আর পেপসির মধ্যেও দ্বন্দ্বযুদ্ধ \r\nবিদ্যমান।</p><p><br></p><p>কোকা-কোলা এবং পেপসির মধ্যে মার্কেট শেয়ার নিয়ে কর্তৃত্ব বিস্তারের যে \r\nপ্রতিদ্বন্দ্বী মনোভাব চলে আসছে, সেটি সামগ্রিকভাবে ‘কোলা ওয়ার্স’ নামে \r\nপরিচিত। একশ বছরেরও বেশি সময় ধরে তারা বাজারে নিজেদের প্রতিযোগিতার \r\nদৌরাত্ম্য টিকিয়ে রেখেছে, চলে এসেছে তাদের প্রতিদ্বন্দ্বিতার নির্বাক \r\nযুদ্ধ।</p>', '9,11', 'writer-nobin-6058573246.jpg', 'কোক-আর-পেপসির-মধ্যে-চলা-নির্বাক-প্রতিদ্বন্দ্বিতা-9173640014', '2022-12-10 18:00:00', '2022-12-07 08:49:34'),
(3, 1, 9, 'হতবুদ্ধি স্পেনকে হারিয়ে আরব্য রজনী লিখল মরক্কো', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s', '<p>মাত্রই বছর চারেক আগের কথা। রাশিয়া বিশ্বকাপে গ্রুপপর্ব থেকেই একে একে বাদ\r\n পড়েছিল আফ্রিকা মহাদেশ থেকে সুযোগ পাওয়া পাঁচটা দেশই। আর এখন পর্যন্ত \r\nনকআউট পর্বে ইউরোপীয় দলগুলোর সঙ্গে খেলা ১০টি ম্যাচের মধ্যে ৯টিতেই যখন \r\nহেরেছে আফ্রিকান দেশগুলো, টুর্নামেন্ট শুরুর আগে স্যামুয়েল ইতোর \r\nভবিষ্যদ্বাণী শুনে মুখ টিপে হাসার মানুষের বিশেষ অভাব ছিল না বৈকি। কী \r\nবলেছিলেন ইতো? বলেছিলেন, বিশ্বকাপ ফাইনালে মরক্কোকে ফাইনালে হারিয়ে \r\nবিশ্বকাপ জিতবে ক্যামেরুন। </p><p><br></p><p><br></p><p>ক্যামেরুন বাদ পড়ে গেছে গ্রুপপর্ব থেকেই, তবে শেষ ১৬’র টিকেট কেটেছে \r\nমরক্কো। তারা মুখোমুখি হয়েছিল ‘পরাক্রমশালী’ স্পেনের। সেই স্পেন, যারা \r\n‘ফ্লুইড ফুটবল’ খেলে প্রথম ম্যাচে মন কেড়েছে, বুঝিয়েছে কেন তারা ফেভারিট।\r\n আবার এরপরই তারা ফিরে গেছে তাদের চিরাচরিত সমস্যায় – গোলস্কোরিং। \r\nগ্রুপপর্বে শেষ অবধি তো এমন পরিস্থিতিই দাঁড়িয়েছিল যে জার্মানির সাথে \r\nসাথে বাদ পড়তে পারত তারাও! স্পেন-জার্মানি-জাপান-কোস্টারিকায় গড়া \r\nগ্রুপটায় যদি প্রথম দুই দল হতো জাপান-কোস্টারিকা, তবে সে এক কাণ্ড হয়ে \r\nযেত বৈকি!&nbsp; <br></p>', '18,20', 'writer-nobin-5937988463.webp', 'হতবুদ্ধি-স্পেনকে-হারিয়ে-আরব্য-রজনী-লিখল-মরক্কো-5980832815', '2022-12-10 18:00:00', '2022-12-07 08:56:03'),
(4, 7, 7, 'শীত কাটুক সুস্থতায়', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s', '<p>হিম পড়া শুরু হয়ে গিয়েছে। শীত এই চলেই এলো! খেজুর গুড়, রস, পিঠা, নকশা করা \r\nজামা, চাদর আরও কত কিছুতে মিশে থাকে শীত। তবে শুধু কি এগুলোই ভালো ভালো \r\nসবকিছু? একদম নয়! শীত মানেই থাকে ঠান্ডা, জ্বর, সর্দির মতো ছোটখাট অসুখ \r\nথেকে শুরু করে নিউমোনিয়ার মতো বড় বড় অসুখ বাধিয়ে ফেলার সম্ভাবনাও। তবে আজ \r\nএমন কিছু অসুখের কথা জানাবো যেগুলো এতটা বেশি না হয়ে থাকলেও শীতে অনেকেই \r\nভুগে থাকেন এই জটিলতাগুলোয়। চলুন, একবার জেনে নেওয়া যাক সেই অসুখগুলোর নাম \r\nআর সমাধানের ব্যাপারে।</p><p><br></p><h3><strong>কানের সংক্রমণ</strong></h3><p>কানে নানারকম সংক্রমণ দেখা দিতে পারে পুরো বছরজুড়েই। তবে শীতে এই সমস্যা খুব মারাত্মক অবস্থায় চলে যেতে পারে। সাধারণত এক্ষেত্রে <a href=\"https://www.narayanahealth.org/blog/winter-diseases-guide-to-protect-yourselves/\" target=\"_blank\" rel=\"noopener\">স্ট্রেপটোককাস নিউমোনিয়া বা হেমোফিলাস ইনফ্লুয়েঞ্জার</a>\r\n মতো ব্যাকটেরিয়া কানে প্রদাহ তৈরি করে, আর সেখান থেকেই কানের মাঝখানের \r\nঅংশে তরল পদার্থ জমা হয়। এছাড়াও শীতে ঠান্ডা, ধূমপান, সাইনাস সংক্রমণ বা \r\nআবহাওয়ার পরিবর্তনের কারণেও এমনটা হতে পারে।</p><p><br></p>\r\n<p><strong>লক্ষণ:</strong> এই সংক্রমণের বেলায় আক্রান্ত ব্যক্তি কানে প্রচন্ড ব্যথা অনুভব করতে পারেন। সাথে কানে না শোনার মতো ব্যাপারও ঘটতে পারে।</p><h3></h3><p></p>', '14', 'writer-nobin-8980417102.webp', 'শীত-কাটুক-সুস্থতায়-5601569392', '2022-12-06 18:00:00', '2022-12-07 08:58:24');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `desp`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(5, 1, 7, 'নুয়ারা এলিয়া শ্রীলঙ্কার বুকে একখন্ড ‘ইংল্যান্ড’', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s', '<p>মানুষ যন্ত্রের মতো একটানা মনোযোগ ধরে রাখতে পারে না কোনোকিছুতেই। মানুষকে \r\nতার এই সীমাবদ্ধতা মেনে নিয়েই এগিয়ে যেতে হয়। একঘেয়ে নাগরিক জীবনে \r\nএকটানা অনেকদিন থাকার পর শরীর ও মন আর কুলোতে চায় না। ক্লান্ত হৃদয় \r\nযান্ত্রিকতা ছেড়ে বেরিয়ে যাওয়ার জন্য হাসফাঁস করে। এরই ফলশ্রুতিতে আমরা \r\nসুযোগমতো বেরিয়ে পড়ি। প্রকৃতির কাছাকাছি থাকা যায়– এমন জায়গাগুলো \r\nআমাদের পদচারণায় মুখরিত হয়ে ওঠে।</p><p><br></p><p>আমাদের দেশে কক্সবাজার, সাজেক কিংবা সেইন্ট মার্টিন দ্বীপের মতো \r\nজায়গাগুলোতে সারাবছরই অসংখ্য মানুষ যান ঠিক এই কারণেই। নাগরিক জীবনের \r\nক্লান্তি থেকে উঠে আসতে এই জায়গাগুলোর বিকল্প নেই। আমাদের দেশে যেমন এই \r\nজায়গাগুলোতে মানুষজন গিয়ে সময় কাটিয়ে আসে, পৃথিবীর প্রতিটি দেশেই এমন \r\nবেশ কিছু জায়গা থাকে, যেগুলোতে সে দেশের নাগরিকেরা পাড়ি জমায়।</p><p><br></p><p><img style=\"width: 50%;\" src=\"data:image/webp;base64,\" data-filename=\"image-11.webp\"><br></p><p><br></p><p>ধরুন, আপনি এমন একটি জায়গা ঘুরতে বেড়িয়েছেন, যেখানে আপনাকে বহনকারী \r\nগাড়ি পাহাড়ি আঁকাবাঁকা রাস্তায় স্বাচ্ছন্দ্যে এগিয়ে চলেছে, পাহাড়ের \r\nমধ্য দিয়ে প্রবাহিত ঠান্ডা বাতাস আপনার হৃদয় জুড়িয়ে দিচ্ছে, আপনি চোখ \r\nবন্ধ করে সেই স্বর্গীয় মুহুর্তগুলো অনুভব করছেন– এসব ভাবতেও কেমন চমৎকার \r\nসুখানুভূতি পাওয়া যায়।</p>', '9,14,15,16,24', 'writer-nobin-7191764616.jpg', 'নুয়ারা-এলিয়া-শ্রীলঙ্কার-বুকে-একখন্ড-‘ইংল্যান্ড’-6718215785', '2022-12-07 08:58:24', '2022-12-07 09:00:34');
INSERT INTO `posts` (`id`, `author_id`, `category_id`, `title`, `short_desp`, `desp`, `tag_id`, `feat_image`, `slug`, `created_at`, `updated_at`) VALUES
(6, 7, 9, 'নিয়তিই শুধু পারে এই গল্পকে ব্যাখ্যা করতে: রদ্রিগো গোয়েস', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s', '<h2><strong>এরিক (রদ্রিগোর বাবা)</strong></h2><p>দুর্দান্ত এক সময় যাচ্ছে। রদ্রিগো একের পর এক ম্যাচ খেলছে, আর ইউরোপের বড়\r\n বড় সব ক্লাবের প্রস্তাব আসছে আমাদের কাছে। আমার মনে আছে, রদ্রিগোর রুমের \r\nদেয়ালে রিয়াল মাদ্রিদের একটা পোস্টার ছিল। আর প্রতি রাতে ঘুমাতে যাওয়ার \r\nআগে সে ঐ পোস্টারের দিকে একবার তাকাত। পরে আমি তো তাকে একটা রিয়াল \r\nমাদ্রিদের জার্সি কিনে দিলাম। বলা তো যায় না, যদি তারা আসলেই ওকে কিনে \r\nফেলে। জানতাম, মাদ্রিদ আমার ছেলেকে চোখে চোখে রাখছে। কিন্তু একদম তাদের কাছ\r\n থেকে কিছুই তখনও শুনিনি।</p><p><br></p><p>তাই, আমরা অপেক্ষা করতে থাকলাম, করতেই থাকলাম। একসময় ইউরোপের অন্য এক \r\nক্লাবের সাথে চুক্তিটা প্রায় হয়েই গিয়েছিল। শুধু রদ্রিগোর স্বাক্ষরটা \r\nকরাটা বাকি।</p><p><br></p><h2><strong>রদ্রিগো</strong></h2>\r\n<p>আমি প্রায় মেনেই নিয়েছিলাম, এ জীবনে আর রিয়াল মাদ্রিদের হয়ে খেলার \r\nসৌভাগ্য হবে না। কিন্তু মনের গহীন কোণে ১ শতাংশ আশাও তখন বেঁচে ছিল। ভিলা \r\nবেলমিরোতে ভিতোরিয়ার সাথে ম্যাচের সময় বাবা আমাকে ডেকে অন্য এক ক্লাবের \r\nপ্রস্তাব পাকাপাকি করে ফেলার কথাটা জিজ্ঞেস করলেন। আমি বললাম, “কিন্তু \r\nরিয়াল মাদ্রিদ?”</p><p></p><p></p>', '18,20', 'writer-nobin-3044334250.webp', 'নিয়তিই-শুধু-পারে-এই-গল্পকে-ব্যাখ্যা-করতে:-রদ্রিগো-গোয়েস-7102841925', '2022-12-07 09:02:00', '2022-12-07 09:02:00'),
